import React from 'react';

export default class LoginPage extends React.Component {
    render() {
        return (
            <div>
                <h2>Kosen Community</h2>
                <input placeholder="Email"/>
                <input placeholder="Nuuts ug"/>
                <button>Nevtreh</button>
                <div>
                    Nuuts ug martsan
                </div>
                <div>
                    Burtguuleh
                </div>
            </div>
        );
    }
}
